import React from "react";
import JobDetails from "../JobDetails";

function Job(props) {
    return <div id="mainContainer">
        {
            props.jobs.map((item) => {
                return <div id="card">
                    <h3>{item.title}</h3>
                    <h6>{item.salary}</h6>

                </div>
            })
      }
  </div>;
}

export default Job;
